import React from 'react';
import {Tweet} from "../Types"

type Props = {
  tweet : Tweet
  handleDelete:(tweet: Tweet) => void;
}

const TweetItem: React.FC<Props> = ({tweet, handleDelete}) => {
  return (
    <li>
       <label>
          <span className = "checkbox-label">{tweet.title}</span>
       </label>
       <button 
          onClick = {() => handleDelete(tweet)} 
          className = "btn is-delete"
       >Delete</button>
    </li>
  )
}

export default TweetItem;
